  `uid` int(11) NOT NULL,
  `username` char(30) NOT NULL,
  `paytype` char(20) NOT NULL COMMENT '存款方式标识',
  `paytypetitle` varchar(60) NOT NULL COMMENT '存款方式名称',
  `trano` char(60) NOT NULL COMMENT '单号',
  `threetrano` char(255) NOT NULL COMMENT '第三方订单号',
