  `id` int(11) NOT NULL AUTO_INCREMENT,
  `isdraw` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0未开 1中 -1未中 -2撤单',
  `trano` char(60) NOT NULL COMMENT '单号',
  `yjf` char(10) NOT NULL DEFAULT '1' COMMENT '1元 0.1 角 0.01分 0.001厘',
